t','open','closed','','the-new-umoma-opens-its-doors','','','2021-06-11 17:50:52','2021-06-11 17:50:52','',0,'http://lawrenceztang.com/wp-content/uploads/2021/06/2020-landscape-1.png',0,'attachment','image/png',0),(16,1,'2021-06-11 17:50:52','2021-06-11 17:50:52','<!-- wp:group {\"align\":\"full\"} -->\n<div class=\"wp-block-group alignfull\" id=\"ambitions\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\",\"level\":3,\"textColor\":\"background\"} -->\n<h3 class=\"has-text-align-center has-background-color has-text-color\">Student at the University of Chicago</h3>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"align\":\"center\",\"id\":80,\"width\":290,\"height\":515,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-large is-resized\"><img src=\"http://lawrenceztang.com/wp-content/uploads/2021/06/lawrence_tang-2.jpeg\" alt=\"\" class=\"wp-image-80\" width=\"290\" height=\"515\"/></figure></div>\n<!-- /wp:image --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"align\":\"full\",\"backgroundColor\":\"subtle-background\"} -->\n<div class=\"wp-block-group alignfull has-subtle-background-background-color has-background\" id=\"my-journey\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\",\"align\":\"full\"} -->\n<h2 class=\"alignfull has-text-align-center\">My Journey</h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:group {\"backgroundColor\":\"secondary\"} -->\n<div class=\"wp-block-group has-secondary-background-color has-background\"><div class=\"wp-block-group__inner-container\"><!-- wp:image {\"align\":\"full\",\"id\":70,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image alignfull size-large\"><img src=\"http://lawrenceztang.com/wp-content/uploads/2021/06/fhs.jpg\" alt=\"\" class=\"wp-image-70\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Student at Falmouth High School</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>September 2016 -- June 2020</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Valedictorian</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:spacer {\"height\":1} -->\n<div style=\"height:1px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"backgroundColor\":\"primary\"} -->\n<div class=\"wp-block-group has-primary-background-color has-background\"><div class=\"wp-block-group__inner-container\"><!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:image {\"id\":130,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://lawrenceztang.com/wp-content/uploads/2021/06/thumbnail_20210301_155230-1-768x1024.jpg\" alt=\"\" class=\"wp-image-130\"/></figure>\n<!-- /wp:image --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Student at the University of Chicago</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Major in computer science and mathematics</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>September 2020 -- Present</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"></div></div>\n<!-- /wp:group --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"top\"} -->\n<div class=\"wp-block-column is-vertically-aligned-top\"><!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:spacer {\"height\":308} -->\n<div style=\"height:308px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"backgroundColor\":\"primary\"} -->\n<div class=\"wp-block-group has-primary-background-color has-background\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"level\":4} -->\n<h4>Research Assistant at WHOI\'s Autonomous Robotics and Perception Laboratory</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>June 2019 -- August 2019</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Computer vision in autonomous underwater vehicles</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:spacer {\"height\":58} -->\n<div style=\"height:58px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"backgroundColor\":\"background\"} -->\n<div class=\"wp-block-group has-background-background-color has-background\"><div class=\"wp-block-group__inner-container\"><!-- wp:image {\"align\":\"center\",\"id\":68,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-large\"><img src=\"http://lawrenceztang.com/wp-content/uploads/2021/06/thumbnail_20210505_155434-768x1024.jpg\" alt=\"\" class=\"wp-image-68\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4>Research Assistant at the Human-Robotic Interaction Lab at the University of Chicago</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>October 2020 -- June 2021</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>ROS (Robot Operating System) programming for robots including SoftBank Robotic\'s NAO, Misty Robotic\'s Misty II, and Anki\'s Vector.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:spacer {\"height\":1} -->\n<div style=\"height:1px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"backgroundColor\":\"secondary\"} -->\n<div class=\"wp-block-group has-secondary-background-color has-background\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"level\":4} -->\n<h4>Research Assistant at Argonne National Laboratory</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>June 2021 -- Present</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"align\":\"full\"} -->\n<div class=\"wp-block-group alignfull\" id=\"projects\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\",\"align\":\"full\",\"textColor\":\"background\"} -->\n<h2 class=\"alignfull has-text-align-center has-background-color has-text-color\">Projects</h2>\n<!-- /wp:heading -->\n\n<!-- wp:media-text {\"mediaId\":63,\"mediaLink\":\"http://lawrenceztang.com/?attachment_id=63\",\"mediaType\":\"image\",\"mediaWidth\":44,\"backgroundColor\":\"primary\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile has-primary-background-color has-background\" style=\"grid-template-columns:44% auto\"><figure class=\"wp-block-media-text__media\"><img src=\"http://lawrenceztang.com/wp-content/uploads/2021/06/Screenshot-96-1024x488.png\" alt=\"\" class=\"wp-image-63 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"level\":4} -->\n<h4><a href=\"http://beat-the-market.herokuapp.com\">Beat the Market</a></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>A web stock simulation using historical data that allows users to test trading strategies </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://github.com/lawrenceztang/stock-website\">Source</a></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaId\":108,\"mediaLink\":\"http://lawrenceztang.com/?attachment_id=108\",\"mediaType\":\"image\",\"mediaWidth\":23,\"backgroundColor\":\"primary\"} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile has-primary-background-color has-background\" style=\"grid-template-columns:auto 23%\"><figure class=\"wp-block-media-text__media\"><img src=\"http://lawrenceztang.com/wp-content/uploads/2021/06/Screenshot_20210626-184526_Messages-461x1024.jpg\" alt=\"\" class=\"wp-image-108 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading {\"level\":4} -->\n<h4><a href=\"https://play.google.com/store/apps/details?id=com.innovativeutilities.lawrence.popular\">Popula</a></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content…\"} -->\n<p>An Android app that allows users to receive notifications for randomly generated text messages</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://github.com/lawrenceztang/popula\">Source</a></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaId\":76,\"mediaLink\":\"http://lawrenceztang.com/?attachment_id=76\",\"mediaType\":\"video\",\"mediaWidth\":28,\"backgroundColor\":\"primary\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile has-primary-background-color has-background\" style=\"grid-template-columns:28% auto\"><figure class=\"wp-block-media-text__media\"><video controls src=\"http://lawrenceztang.com/wp-content/uploads/2021/06/Chess-2021-06-26-21-16-22_Trim-2.mp4\"></video></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading {\"level\":4} -->\n<h4><a href=\"https://github.com/lawrenceztang/Chess_Engine\">Chess Engine</a></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content…\"} -->\n<p>Includes a chess engine, graphical user interface, and game engine that allows the user to play against the computer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://github.com/lawrenceztang/Chess_Engine\">Source</a></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:paragraph {\"align\":\"center\",\"backgroundColor\":\"primary\"} -->\n<p class=\"has-text-align-center has-primary-background-color has-background\">Find more at <a href=\"https://github.com/lawrenceztang\">https://github.com/lawrenceztang</a></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"align\":\"full\",\"backgroundColor\":\"background\"} -->\n<div class=\"wp-block-group alignfull has-background-background-color has-background\" id=\"hobbies\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\"} -->\n<h2 class=\"has-text-align-center\">Hobbies</h2>\n<!-- /wp:heading -->\n\n<!-- wp:media-text {\"mediaId\":111,\"mediaLink\":\"http://lawrenceztang.com/?attachment_id=111\",\"mediaType\":\"image\",\"backgroundColor\":\"background\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile has-background-background-color has-background\"><figure class=\"wp-block-media-text__media\"><img src=\"http://lawrenceztang.com/wp-content/uploads/2021/06/20210626_163546-1024x768.jpg\" alt=\"\" class=\"wp-image-111 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading {\"level\":4} -->\n<h4>Rubik\'s Cubing</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>3x3 record of 14.45 seconds</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaPosition\":\"right\"} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading {\"level\":4} -->\n<h4>Tennis</h4>\n<!-- /wp:heading --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading {\"level\":4} -->\n<h4>Fishing</h4>\n<!-- /wp:heading --></div></div>\n<!-- /wp:media-text --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"align\":\"full\",\"backgroundColor\":\"secondary\"} -->\n<div class=\"wp-block-group alignfull has-secondary-background-color has-background\" id=\"ambitions\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\",\"align\":\"full\"} -->\n<h2 class=\"alignfull has-text-align-center\">Ambitions</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>After college, I plan on going to graduate school for a Master\'s (my dream school is Stanford). I envision working as a quantitative analyst or data scientist. I would like to travel and explore the world—I hope I can one day journey to Mars.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"align\":\"full\",\"backgroundColor\":\"subtle-background\"} -->\n<div class=\"wp-block-group alignfull has-subtle-background-background-color has-background\" id=\"in-the-news\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\",\"align\":\"full\"} -->\n<h2 class=\"alignfull has-text-align-center\">In the News</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><a href=\"https://www.capenews.net/falmouth/news/falmouth-high-senior-receives-academic-excellence-award/article_85287d02-eeda-5165-b8af-b0a8d2eae28a.html\">Falmouth High Senior Receives Academic Excellence Award</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><a href=\"https://www.barnstablepatriot.com/news/20200302/cape-education-briefs\">Falmouth Student Candidate to be Presidential Scholar</a></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"align\":\"wide\",\"style\":{\"color\":{\"background\":\"#ffffff\"}}} -->\n<div class=\"wp-block-group alignwide has-background\" style=\"background-col