n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaPosition\":\"right\",\"mediaId\":108,\"mediaLink\":\"http://lawrenceztang.com/?attachment_id=108\",\"mediaType\":\"image\",\"mediaWidth\":28} -->\n<div class=\"wp-block-media-text alignwide has-media-on-the-right is-stacked-on-mobile\" style=\"grid-template-columns:auto 28%\"><figure class=\"wp-block-media-text__media\"><img src=\"http://lawrenceztang.com/wp-content/uploads/2021/06/Screenshot_20210626-184526_Messages-461x1024.jpg\" alt=\"\" class=\"wp-image-108 size-full\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading {\"level\":4} -->\n<h4><a href=\"https://play.google.com/store/apps/details?id=com.innovativeutilities.lawrence.popular\">Popula</a></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content…\"} -->\n<p>An Android app that allows users to receive notifications for randomly generated text messages</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://github.com/lawrenceztang/popula\">Source</a></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:media-text {\"mediaId\":76,\"mediaLink\":\"http://lawrenceztang.com/?attachment_id=76\",\"mediaType\":\"video\",\"mediaWidth\":28} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\" style=\"grid-template-columns:28% auto\"><figure class=\"wp-block-media-text__media\"><video controls src=\"http://lawrenceztang.com/wp-content/uploads/2021/06/Chess-2021-06-26-21-16-22_Trim-2.mp4\"></video></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading {\"level\":4} -->\n<h4><a href=\"https://github.com/lawrenceztang/Chess_Engine\">Chess Engine</a></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Content…\"} -->\n<p>Includes a chess engine, graphical user interface, and game engine that allows the user to play against the computer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://github.com/lawrenceztang/Chess